import logo from '../img/logo.png';
import { Link } from "react-router-dom";
import CartWidget from "./CartWidget.js";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import NavbarBootstrap from 'react-bootstrap/Navbar';

function Navbar() {
  return (
    <NavbarBootstrap bg="light" expand="lg" sticky="top">
      <Container>
          <NavbarBootstrap.Toggle aria-controls="basic-Navbar-nav" className='order-lg-1'/>
            <NavbarBootstrap.Brand className='order-lg-0'>
            <Link to={`/`}/>
              <img src={logo} alt="Logo" width="200" height="70" className="d-inline-block align-text-top"></img>
            </NavbarBootstrap.Brand>
            <CartWidget/>
          <NavbarBootstrap.Collapse id="basic-Navbar-nav">
            <Nav className="me-auto text-center">
              <Nav.Link><Link to={`/category/4`}>Velas y bengalas</Link></Nav.Link>
              <Link to={`/category/1`}><Nav.Link>Globos</Nav.Link></Link>
              <Link to={`/category/2`}><Nav.Link>Banderines</Nav.Link></Link>
              <Link to={`/category/3`}><Nav.Link>Adornos para tortas</Nav.Link></Link>
            </Nav>
          </NavbarBootstrap.Collapse>
      </Container>
    </NavbarBootstrap>
  );
}

export default Navbar;
